import React, { useState } from 'react';
import { useTable } from 'react-table';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

const TeacherManagement = () => {
  const [exercises, setExercises] = useState([]);
  const [newExercise, setNewExercise] = useState({ title: '', description: '' });
  const [studentsProgress, setStudentsProgress] = useState([
    { name: 'Học viên 1', progress: 70 },
    { name: 'Học viên 2', progress: 85 },
    { name: 'Học viên 3', progress: 60 },
  ]);

  const handleAddExercise = () => {
    setExercises([...exercises, newExercise]);
    setNewExercise({ title: '', description: '' });
  };

  const handleDeleteExercise = (index) => {
    const updatedExercises = exercises.filter((_, i) => i !== index);
    setExercises(updatedExercises);
  };

  const columns = React.useMemo(
    () => [
      {
        Header: 'Tiêu đề',
        accessor: 'title',
      },
      {
        Header: 'Mô tả',
        accessor: 'description',
      },
      {
        Header: 'Hành động',
        accessor: 'action',
        Cell: ({ row }) => (
          <button onClick={() => handleDeleteExercise(row.index)}>Xóa</button>
        ),
      },
    ],
    []
  );

  const data = React.useMemo(() => exercises, [exercises]);

  return (
    <div>
      <h1>Quản lý bài tập</h1>
      <div>
        <input
          type="text"
          placeholder="Tiêu đề"
          value={newExercise.title}
          onChange={(e) => setNewExercise({ ...newExercise, title: e.target.value })}
        />
        <textarea
          placeholder="Mô tả"
          value={newExercise.description}
          onChange={(e) => setNewExercise({ ...newExercise, description: e.target.value })}
        />
        <button onClick={handleAddExercise}>Thêm bài tập</button>
      </div>
      
      <h2>Danh sách bài tập</h2>
      <Table columns={columns} data={data} />

      <h2>Phân tích tiến độ học viên</h2>
      <LineChart width={600} height={300} data={studentsProgress}>
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <CartesianGrid strokeDasharray="3 3" />
        <Line type="monotone" dataKey="progress" stroke="#8884d8" />
      </LineChart>
    </div>
  );
};

const Table = ({ columns, data }) => {
  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow,
  } = useTable({ columns, data });

  return (
    <table {...getTableProps()} style={{ border: '1px solid black', marginBottom: '20px' }}>
      <thead>
        {headerGroups.map(headerGroup => (
          <tr {...headerGroup.getHeaderGroupProps()}>
            {headerGroup.headers.map(column => (
              <th {...column.getHeaderProps()}>{column.render('Header')}</th>
            ))}
          </tr>
        ))}
      </thead>
      <tbody {...getTableBodyProps()}>
        {rows.map(row => {
          prepareRow(row);
          return (
            <tr {...row.getRowProps()}>
              {row.cells.map(cell => (
                <td {...cell.getCellProps()}>{cell.render('Cell')}</td>
              ))}
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default TeacherManagement;
